import { Link } from "react-router-dom";
import Header from "../components/Header";
import { useState, useEffect } from 'react';
import Open from '../components/Open';
import DateRangeForm from "../components/DateRangeForm";
import axios from "axios";


const ChartSpend = (props) => {

    const sessionEmail = localStorage.getItem("email");
    const sessionStartDate = localStorage.getItem("startDate");
    const sessionEndDate = localStorage.getItem("endDate");
    const [cost, setCost] = useState({});
    const [items, setItems] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.post('https://www.zoelindev.com/moneyCatBackend/typelist.php', {
                    email: sessionEmail,
                    startDate: sessionStartDate,
                    endDate: sessionEndDate
                });
                setCost(response.data);
            } catch (error) {
                console.error(error);
            }
        };
        fetchData();

        const fetchItems = async () => {
            try {
                const response = await axios.post('https://www.zoelindev.com/moneyCatBackend/typelist.php', {
                    email: sessionEmail,
                    startDate: sessionStartDate,
                    endDate: sessionEndDate
                });
                setItems(response.data);
            } catch (error) {
                console.error(error);
            }
        };
        fetchItems();
    }, [sessionEmail, sessionStartDate, sessionEndDate]);

    return (
        <div className="chartWrap">
            <Header />
            <div className="round3"></div>
            <h2>Monthly</h2>

            <div className="op">
                <Link to="/chart_spend" className="chartSpendBtn">
                    Spend /
                </Link>
                <Link to="/chart_income" className="chartIncomeBtn">
                    Income
                </Link>
            </div>

            <div className="top">
                {/* <Doughnut data={data} className="chart"/>; */}
                <DateRangeForm email={sessionEmail} />
            </div>

            <div className="spendDetail">
                <Open title="Food" cost={cost['food']}>
                    {cost['food'] && cost['food'].items
                        .filter(item => item.type === 'food')
                        .map(item => (
                            <p key={item.id}>
                                {item.date}: {item.note} ${item.cost}
                            </p>
                        ))
                    }
                </Open>
                <Open title="Home" cost={cost['home']}>
                    {items.filter(item => item.type === "home").map(item => (
                        <p key={item.id}>{item.date} {item.note} ${item.cost}</p>
                    ))}
                </Open>
                <Open title="Fun" cost={cost['fun']}>
                    {items.filter(item => item.type === "fun").map(item => (
                        <p key={item.id}>{item.date} {item.note} ${item.cost}</p>
                    ))}
                </Open>
                <Open title="Travel" cost={cost['travel']}>
                    {items.filter(item => item.type === "travel").map(item => (
                        <p key={item.id}>{item.date} {item.note} ${item.cost}</p>
                    ))}
                </Open>
                <Open title="Health" cost={cost['health']}>
                    {items.filter(item => item.type === "health").map(item => (
                        <p key={item.id}>{item.date} {item.note} ${item.cost}</p>
                    ))}
                </Open>

                <Open title="Learn" cost={cost['learn']}>
                    {items.filter(item => item.type === "learn").map(item => (
                        <p key={item.id}>{item.date} {item.note} ${item.cost}</p>
                    ))}
                </Open>

                <Open title="Shop" cost={cost['shop']}>
                    {items.filter(item => item.type === "shop").map(item => (
                        <p key={item.id}>{item.date} {item.note} ${item.cost}</p>
                    ))}
                </Open>

                <Open title="Lend" cost={cost['lend']}>
                    {items.filter(item => item.type === "lend").map(item => (
                        <p key={item.id}>{item.date} {item.note} ${item.cost}</p>
                    ))}
                </Open>

                <Open title="Others" cost={cost['others']}>
                    {items.filter(item => item.type === "others").map(item => (
                        <p key={item.id}>{item.date} {item.note} ${item.cost}</p>
                    ))}
                </Open>
            </div>
        </div>
    );
}

export default ChartSpend;
